export const actionTypes = {
    GET_ALL_COUPON_REQUEST: 'GET_ALL_COUPON_REQUEST',
    GET_ALL_COUPON_SUCCESS: 'GET_ALL_COUPON_SUCCESS',
    GET_INACTIVE_COUPON_REQUEST: 'GET_INACTIVE_COUPON_REQUEST',
    GET_INACTIVE_COUPON_SUCCESS: 'GET_INACTIVE_COUPON_SUCCESS'
};

export function getAllCoupon(payload) {
    console.log(payload,'1')
    return { type: actionTypes.GET_ALL_COUPON_REQUEST, payload };
}

export function getAllCouponSuccess(payload) {
    console.log(payload,'2')
    return { type: actionTypes.GET_ALL_COUPON_SUCCESS, payload };
}

export function getInactiveCoupon(payload) {
    console.log(payload,'3')
    return { type: actionTypes.GET_INACTIVE_COUPON_REQUEST, payload };
}

export function getInactiveCouponSuccess(payload) {
    console.log(payload,'4')
    return { type: actionTypes.GET_INACTIVE_COUPON_SUCCESS, payload };
}
